import React from "react";
import { Container, LogoContainer } from "../Appbar/AppbarElements";
import Logo from "../../images/budget.png";

const Auth = () => {
  return (
    <Container>
      <LogoContainer>
        <img src={Logo} alt="Logo" />
      </LogoContainer>
    </Container>
  );
};

export default Auth;
